import React from 'react';
import Header from './components/header';
import "./styles.css";
import Umidade, {Component} from './pages/main/umidade';
import { useEffect, useState } from 'react';
import {
  BarChart,
  Bar,
  Line,
  LineChart,
  XAxis,
  YAxis,
  Tooltip
} from 'recharts';


const App = () => (
  <div className="App">
    <Header/>
    <Umidade />
    <h1>Real Time CPU Usage</h1>
      <LineChart width={500} height={300} data={Umidade.umid}>
        <XAxis dataKey="name" />
        <YAxis />
        <Line dataKey="value" />
      </LineChart>
  </div>
);




export default App;
